float xrot = 0;
float yrot = 0;
float xdiff = 0;
float ydiff = 0;
bool mousedown = false;
bool isColorOneActive = false;

void handleMouseButton(int button, int state, int x, int y) {
	if (button == GLUT_LEFT_BUTTON && state == GLUT_DOWN) {
		mousedown = true;
		xdiff = x - yrot;
		ydiff = -y + xrot;
	} else {
		mousedown = false;
	}

	glutPostRedisplay();
}

void handleMouseMove(int x, int y) {
	if (mousedown) {
		yrot = x - xdiff;
		xrot = y + ydiff;

		glutPostRedisplay();
	}
}

void handleKeyboard(unsigned char key, int x, int y) {
	switch (key) {
		case 'a':
		case 'A':
			// bergeser ke kiri
			glTranslatef(-1.0, 0.0, 0.0);
			break;
		case 'd':
		case 'D':
			// bergeser ke kanan
			glTranslatef(1.0, 0.0, 0.0);
			break;
		case 'w':
		case 'W':
			// bergeser ke atas
			glTranslatef(0.0, 1.0, 0.0);
			break;
		case 's':
		case 'S':
			// bergeser ke bawah
			glTranslatef(0.0, -1.0, 0.0);
			break;
		case 'x':
		case 'X':
			// berotasi ke kanan
			glRotatef(1.0, 0.0, 0.0, -5.0);
			break;
		case 'z':
		case 'Z':
			// berotasi ke kiri
			glRotatef(1.0, 0.0, 0.0, 5.0);
			break;
		case 'c':
		case 'C':
			// perbesar
			glTranslatef(0.0, 0.0, 5.0);
			break;
		case 'v':
		case 'V':
			// perkecil
			glTranslatef(0.0, 0.0, -5.0);
			break;
	}

	glutPostRedisplay();
}

void reshape(int w, int h) {
	if (h == 0) h = 1;

	GLfloat aspect = (GLfloat)w / (GLfloat)h;
	glViewport(0, 25, w, h);
	glMatrixMode(GL_PROJECTION);
	glLoadIdentity();
	gluPerspective(45.0f, aspect, 0.1f, -1.0f);
}

