void display() {
	glClear(GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT);
	glPushMatrix();
	gluLookAt(0, 70, -350, 0, 0, 0, 0, 1, 0);
	glRotatef(xrot, 1, 0, 0);
	glRotatef(yrot, 0, 1, 0);

	if (isColorOneActive) glClearColor(0.3, 0.1, 0.5, 1.0);
	else glClearColor(0.3, 0.2, 0.6, 1.0);

	blueObject();
	whiteObject();
	yellowObject();
	brownSmoothObject();
	blueSmoothObject();
	greyObject();
	greySmoothObject();
	brownDarkObject();
	brownSuperDarkObject();
	greyDarkObject();

	glPopMatrix();
	glutSwapBuffers();
}

void myInit() {
	glClearColor(0.5, 0.2, 0.8, 1.0);
	glLineWidth(2);
	glClearDepth(1.0f);
	glEnable(GL_DEPTH_TEST);
	glEnable(GL_BLEND);
	glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);
	glDepthFunc(GL_LEQUAL);
	glShadeModel(GL_SMOOTH);
	glHint(GL_PERSPECTIVE_CORRECTION_HINT, GL_NICEST);
	glMatrixMode(GL_MODELVIEW);
}

void handleTimer(int) {
	isColorOneActive = !isColorOneActive;

	glutTimerFunc(700, handleTimer, 0);
	glutPostRedisplay();
}

int main(int argc, char** argv) {
	glutInit(&argc, argv);
	glutInitDisplayMode(GLUT_DOUBLE | GLUT_RGB);
	glutInitWindowSize(1000, 600);
	glutCreateWindow("KAPAL PESIAR - OASIS OF THE SEAS");
	myInit();
	glutDisplayFunc(display);
	glutReshapeFunc(reshape);
	glutKeyboardFunc(handleKeyboard);
	glutMouseFunc(handleMouseButton);
	glutMotionFunc(handleMouseMove);
	glutTimerFunc(600, handleTimer, 10);

	glutMainLoop();
	return 0;
}